/*
	Getting covariates info for basic plots
DO:
    1. Pick random table
	2. Join with needed information

101719
*/

/* 1. Pick random table */
	/* check */
	SELECT TOP 100 *
	FROM jc574.dbo.random_stra_101719_3
	ORDER BY MemberId; /*case range: 2008-12-31 to 2013-12-31 */
	

/* 2. Join with covariates from MedicalClaims table*/
	
	SELECT t1.HmsAetnaLineId, t1.MemberId, t1.DateServiceStarted, t1.Icd,
		t2.MemberBirthYear, t2.MemberGender, t2.EmployeeZipCode
	INTO jc574.dbo.random_cov_101719_1
	FROM jc574.dbo.random_stra_101719_3 AS t1
	LEFT JOIN
		dbo.MedicalClaims AS t2
	ON t1.HmsAetnaLineId = t2.HmsAetnaLineId;
	


/*
	Getting chronic and PTLDS Symptoms info for patients
